Fairview Community Star Party  &nbsp;

 The Texas Astronomical Society of Dallas (TAS) is sponsoring community Star Parties on the first Saturday of each month. Our next event is&nbsp;Saturday, March 4, 2023.&nbsp;

 &nbsp;

 The Star Party events will take place on LovejoyISD Sloan Creek Intermediate School campus,&nbsp;440 Country Club Road, Fairview, Texas 75069. We will be setup on the Track and Field east of the school building.

 &nbsp;

 Each Star Party will start 30 minutes after sunset. &nbsp;Feel free to bring your own blankets, lawn chairs, binoculars, and dress for the expected temperatures.


TAS Volunteers will conduct an introductory “naked eye” tour of the night sky and a variety of telescopes will be setup for the general public to observe a selection of lunar, planetary, and deep sky objects through the instruments. Bring the family out for a night of astronomical camaraderie under the Fairview night sky.&nbsp;

First Fridays at McDonnell Planetarium, weather permitting, the  St Louis Astronomical Society  and the Science Center will set up a number of telescopes outdoors and be on-hand to answer your questions.

The telescopes will be set up right outside the McDonnell Planetarium&nbsp; building. Visitors should enter from the Science Center building on Oakland and take walkway across I64 to Planetarium signs and staff should be there to direct you. Telescope viewing begins once it is dark. and will end about 9pm around the Planetarium grounds. Regardless of the weather. You can also join them indoors in the Planetarium theater for “The Sky Tonight”. Showtimes are normally at 7 p.m.
