The February 2023 Globe at Night is a 10 night campaign from the 12th to the 21st. The 2022 GaN Program saw students and observers record&nbsp; 13,218 observations .
Help GaN Program Director, Dr. Connie Walker and the world-wide Globe at Night team reach the goal of 24,000 data points for 2023!
The featured constellation for February 2023 is Orion &amp; Gemini. &nbsp;
The Globe at Night is a citizen-science program that can be paired with your local dark sky activities. &nbsp;
