Have you ever wanted to view the night sky through a telescope? And even better, learn to operate the telescope yourself? If so, you don’t want to miss this opportunity for a FREE training and telescope viewing session provided by amateur astronomers from the St. Louis Astronomical Society.&nbsp;

The evening program will begin inside where it is warm and cozy with hands on training focused on teaching you and your family how to operate and use the library telescopes now available in your public library. Guests will learn how to unpack the telescope, get the telescope ready for operation, find objects in the night sky and about telescope safety issues. Using the telescope is surprisingly easy and fun for the whole family.&nbsp;

Weather permitting, the class will adjourn outside and apply what they have learned to find objects in the night sky. Make sure to dress warm because you will not want to leave once you get started.&nbsp;

